import React from "react";
import { useParams } from "react-router-dom";
import "./index.css";
import ProductList from "../components/ProductList";

const ProductPage = () => {
  const { p_id, p_price } = useParams();

  return (
    <div className="productDetail">
      <h2>베스트 셀러</h2>
      <div className="productImg">
        <img src={`../carimg/s${p_id}.JPG`} alt="" />
      </div>
      <div>
        <p>자동차 연간 베스트</p>
        <p>프리미엄 자동차</p>
        <p>가격 : ${p_price}</p>
        <p><ProductList
              key={pro.p_id}
              p_id={pro.p_id}
              p_name={pro.p_name}
              p_price={pro.p_price}
              p_text={pro.p_text}
            /></p>
      </div>
    </div>
  );
};

export default ProductPage;
